            "ppppm": 0.00792091366818126
        },
    ]
    
    const [data, setData] = useState([]);
    const [data2, setData2] = useState([]);

    useEffect(() => {
        fetch('http://127.0.0.1:8000/api/app/')
        .then(res => res.json())
        .then(data => {
            setData(data);
            setData2(data);
        })
        .catch(err => {
            console.log(err);
        });
    }, []); 

    return (
        <div id="players-main">
            <div id="search-bar-container">
                <input type="text" id="search-bar" placeholder="Search..." onKeyUp={() => {
                    let searchWord = document.getElementById('search-bar').value;
                    let newData = data2.filter(function(player) {
                        return player.name.includes(searchWord)
                    })
                    setData(newData)
                }}></input>
            </div>
            <div id="players-container">
                {data.map((player) => {
                    const { name, price, total_points, minutes, ppm, ppp, ppppm } = player;
                    return (
                        <Player name={name} price={price} total_points={total_points}
                        minutes={minutes} ppm={ppm} ppp={ppp} ppppm={ppppm} />
                    )
                })}
            </div>
        </div>
    )
}

function Player(props) {
    return (
        <div id="player-box">
            <div id="player-box-title">
                <h3>{props.name}</h3>
            </div>
            <div id="player-box-labels-and-values-container">
                <div id="player-box-labels">
                    <p>Price:</p>
                    <p>Total points:</p>
                    <p>Minutes:</p>
                    <p>Points/minute:</p>
                    <p>Points/price:</p>
                    <p>Points/price/minute:</p>
                </div>
                <div id="player-box-values">
                    <p>{props.price}</p>
                    <p>{props.total_points}</p>
                    <p>{props.minutes}</p>
                    <p>{props.ppm.toFixed(4)}</p>
                    <p>{props.ppp.toFixed(4)}</p>
                    <p>{props.ppppm.toFixed(4)}</p>
                </div>
            </div>
            
        </div>
    )
}



export default Players;
